/**
 * @param {string[][]} access_times
 * @return {string[]}
 */
var findHighAccessEmployees = function(access_times) {
    const employeeAccess = {};
    const highAccessEmployees = new Set();

    access_times.forEach(([employee, time]) => {
        if (!employeeAccess[employee]) {
            employeeAccess[employee] = [];
        }
        employeeAccess[employee].push(parseInt(time, 10));
    });

    Object.keys(employeeAccess).forEach(employee => {
        const times = employeeAccess[employee].sort((a, b) => a - b);
        for (let i = 0; i < times.length - 2; i++) {
            if (times[i + 2] - times[i] < 100) {
                highAccessEmployees.add(employee);
                break;
            } else if ((times[i] % 100) <= 59 && (times[i + 2] - times[i] - 40) < 60) {
                highAccessEmployees.add(employee);
                break;
            }
        }
    });

    return [...highAccessEmployees];
};
